function initialize() {
  var mapOptions = {
    zoom: 5,
    center: new google.maps.LatLng(27.700, 85.360),
    mapTypeId: google.maps.MapTypeId.TERRAIN
  };

  var map = new google.maps.Map(document.getElementById('map-canvas'),
      mapOptions);

  var lineSymbol = {
    path: google.maps.SymbolPath.FORWARD_CLOSED_ARROW,
    scale: 2,
    strokeOpacity: 1,
    strokeWeight: 2
  };

  // Draw Arrows
  for (key in data){

    var vector = data[key];

    var lineCoordinates = [
      new google.maps.LatLng(vector[1], vector[0]),
      new google.maps.LatLng(vector[1] + (vector[3] / 15), vector[0] + (vector[2] / 15))
    ];

    var line = new google.maps.Polyline({
      path: lineCoordinates,
      icons: [{
        icon: lineSymbol,
        offset: '100%'
      }],
      map: map,
      strokeColor: 'brown',
      strokeWeight: 1.5
    });
  }
}

google.maps.event.addDomListener(window, 'load', initialize);
